      job_description:
        "Job Description PLEASE NOTE: Positions are available at the junior, mid and senior levels\n\nThe selected candidate will join a high performing agile team that uses the Scaled Agile Framework (SAFe) methodology to support a nationally significant and fast-paced program. Program execution follows DEVOPS best practices and employs robust development, test and production environments. Test Driven Development (TDD) and test automation tools are utilized alongside a full suite of team collaboration tools. The program is focused on injecting new technology and adding advanced capabilities in support of an on-going operational system.\n\nJob Summary\nThe selected individual will perform software development activities as a member of an agile development team. Development includes the full range of turning agile stories into implementable concepts, through development, testing and deployment of the new capabilities in this complex system. Following the TDD pattern our developers are responsible for implementing robust testing leveraging DEVOPS automation and, where appropriate, use of test automation commercial tools. There are a range of opportunities for server side business logic implementation as well as client web application and user interface (UI) development. Java, Python, embedded C/C++, Java cryptographic framework, XML, web UI and special purpose device programming opportunities are available.\n\nPrimary Responsibilities\nResponsibilities include completing software development tasks both individually and as a member of an agile team. The selected individual will actively participate in program increment planning and related team activities. He/she will analyze and study complex system requirements, use design software tools, provide support using formal specifications, data flow diagrams, and other accepted design techniques with the use of Computer Aided Software Engineering (CASE) tools, and will use sound software engineering principles to ensure that developed code is modifiable, efficient, reliable, understandable, fault tolerant, and reusable. The selected candidate will provide software process management and control throughout the coding portion of the software development process, and will promote code reuse and cross-program collaboration by creating common functions and shared actions for developers and testers. He/she will engineer, author, tune and document automation scripts in a development environment and deploy to the test/production bench.\n\nMDOPSRequired Education, Experience, & Skills\n• Bachelor's Degree in Computer Science or a related discipline. Relevant work experience may be substituted for a Degree.\n• Possess Active TS/SCI with Polygraph\n• Experience with Java/JEE.\n• Experience with User Interface development, knowledge of databases and structures, and/or experience working with XHTML, HTML, XML, XSLT.\n• Experience developing on Windows, and/or Linux operating systems.\n• Must have a strong understanding of sound software development principles and practices.\n• Must be able to plan and prioritize personal tasking and be able to communicate effectively verbally and in writing.\n• Must be an independent thinker, capable of performing high quality work, both independently and with a team, in a fast-moving environment.\nMDOPSPreferred Education, Experience, & Skills\n• Experience with the following: JEE, SQL, application servers (Tomcat, WebLogic, JBoss), scripting.\n• Experience with high level requirements management including requirements decomposition, secure systems engineering and development, trade-off analysis, interface control, and testing and continuous integration.\n• Experience in software development on Agile teams using Agile Developer practices such as Pair Programming, TDD, Refactoring, and ATDD.\n• Experience with FITNesse, Mockito, Cucumber, Unified Functional Tester (UFT), Selenium.\n• Experience with Behavior Driven Development (BDD) or Test Driven Development (TDD).\n• Secure Software development (i.e. Layer 7 Policy).\n• Experience with the Scaled Agile Framework (SAFe) methodology, SAFe Agilest Certification, or past experience as a member of an agile team.\nPay Information:\nSalary Range: $136,620 - $232,210\nPlease note: This range is based on our market pay structures. However, individual salaries are determined by a variety of factors including, but not limited to: business considerations, local market conditions, and internal equity, as well as candidate qualifications, such as skills, education, and experience.\nEmployee Benefits: At BAE Systems, we support our employees in all aspects of their life, including their health and financial well-being. Regular employees scheduled to work 20+ hours per week are offered: health, dental, and vision insurance; health savings accounts; a 401(k) savings plan; disability coverage; and life and accident insurance. We also have an employee assistance program, a legal plan, and other perks including discounts on things like home, auto, and pet insurance. Our leave programs include paid time off, paid holidays, as well as other types of leave, including paid parental, military, bereavement, and any applicable federal and state sick leave. Employees may participate in the company recognition program to receive monetary or non-monetary recognition awards. Other incentives may be available based on position level and/or job specifics.\n\nAbout BAE Systems Intelligence & Security BAE Systems, Inc. is the U.S. subsidiary of BAE Systems plc, an international defense, aerospace and security company which delivers a full range of products and services for air, land and naval forces, as well as advanced electronics, security, information technology solutions and customer support services. Improving the future and protecting lives is an ambitious mission, but it’s what we do at BAE Systems. Working here means using your passion and ingenuity where it counts – defending national security with breakthrough technology, superior products, and intelligence solutions. As you develop the latest technology and defend national security, you will continually hone your skills on a team—making a big impact on a global scale. At BAE Systems, you’ll find a rewarding career that truly makes a difference. Intelligence & Security (I&S), based in McLean, Virginia, designs and delivers advanced defense, intelligence, and security solutions that support the important missions of our customers. Our pride and dedication shows in everything we do—from intelligence analysis, cyber operations and IT expertise to systems development, systems integration, and operations and maintenance services. Knowing that our work enables the U.S. military and government to recognize, manage and defeat threats inspires us to push ourselves and our technologies to new levels. At BAE Systems, we celebrate the array of skills, experiences, and perspectives our employees bring to the table. For us, differences are a source of strength. We’re laser-focused on high performance, and we work hard every day to nurture an inclusive culture where all employees can innovate and thrive. Here, you will not only build your career, but you will also enjoy work-life balance, uncover new experiences, and collaborate with passionate colleagues.",
