      job_apply_is_direct: false,
      job_apply_quality_score: 0.6632,
      job_description:
        "Position Summary...\n\nWhat you'll do...\n\nAs part of the Walmart Global sourcing organization, you will be responsible to design and build high performing systems and systems integrations which are production ready for an enterprise level source to commit platform.\nWe are looking for a highly motivated and enthusiastic Staff Software engineering with strong full stack software engineering knowledge in Java, React, JavaScript and is motivated to design and build a robust software solution at an enterprise level.\n\nAbout Team:\nOur team collaborates with Walmart International, which has over 5,900 retail units operating outside of the United States under 55 banners in 26 countries including Africa, Argentina, Canada, Central America, Chile, China, India, Japan, and Mexico, to name a few.\n\nWhat you'll do:\n\n1. Design and build Front end and Back end software applications / services that integrates for the use of Merchants, Sourcing associates and Suppliers\n2. Design, develop and maintain front end applications, back end services that the end users follow to achieve the business flows within the systems.\n3. Work on React, Node JS, Javascript, REST APIs, Serverless, and event-driven micro services.\n4. Utilize Spring Boot or Spring Framework in Java to design and implement low-latency REST APIs with Azure SQL Server and Cassandra as storage systems\n5. Create and deploy large-scale, containerized applications using Docker and Kubernetes in public clouds like Walmart, Google GCP and Microsoft Azure.\n6. Collaborate with other scrum teams, QE, Product, Program Management, and 3rd party teams, while partnering with cross-functional project development teams\n7. Lead and achieve target standards for Engineering excellence and operational excellence.\n8. Mentor and Lead software engineers and lead engineering projects.\n9. Coordinate, create, and complete enterprise architecture including low level and high level designs.\n\nWhat you'll bring:\n\n9+ years hands on experience in Java, React or similar tech stack\n- Strong Full Stack experience (extensive knowledge of both front and back-end technologies)\n- Spring Boot or Spring Framework\n- RESTful Micro services development\n- Relational and/or NoSQL Database experience (Cassandra, Cosmos, Oracle, Azure SQL)\n- Experience with node.js / react / javascript / CSS / HTML\n- Cloud - Azure or Google Cloud Platform (GCP)\n- Full life cycle development experience\n- Experience with clustering software like Kubernetes, Spinnaker, Ansible and good understanding on container orchestrations\n- Strong ability in problem solving\n- Worked on monitoring and alerting tools\n- Design and Documentation Skills\n- Experience with configuring or implementing Build & Deployment (CI/CD) pipeline and infrastructure as a service.\n- Strong base knowledge of computer science, with competencies in algorithms, software design for embedded systems and data structures\n- Good understanding of latest trends of tools and technology in software development and software test automation space\n- A strong sense of accountability and ownership, self-discipline, and focus on high-quality deliverables, and a team-oriented approach that values design thinking, efficiency, and innovation.\n\nAbout Walmart Global Tech\nImagine working in an environment where one line of code can make life easier for hundreds of millions of people. That's what we do at Walmart Global Tech. We're a team of software engineers, data scientists, cybersecurity expert's and service professionals within the world's leading retailer who make an epic impact and are at the forefront of the next retail disruption. People are why we innovate, and people power our innovations. We are people-led and tech-empowered. We train our team in the skillsets of the future and bring in experts like you to help us grow. We have roles for those chasing their first opportunity as well as those looking for the opportunity that will define their career. Here, you can kickstart a great career in tech, gain new skills and experience for virtually every industry, or leverage your expertise to innovate at scale, impact millions and reimagine the future of retail.\n\nFlexible, hybrid work:\nWe use a hybrid way of working that is primarily in office coupled with virtual when not onsite. Our campuses serve as a hub to enhance collaboration, bring us together for purpose and deliver on business needs. This approach helps us make quicker decisions, remove location barriers across our global team and be more flexible in our personal lives.\n\nBenefits:\nBenefits: Beyond our great compensation package, you can receive incentive awards for your performance. Other great perks include 401(k) match, stock purchase plan, paid maternity and parental leave, PTO, multiple health plans, and much more.\n\nEqual Opportunity Employer:\nWalmart, Inc. is an Equal Opportunity Employer - By Choice. We believe we are best equipped to help our associates, customers and the communities we serve live better when we really know them. That means understanding, respecting and valuing diversity- unique styles, experiences, identities, ideas and opinions - while being inclusive of all people.\n\nThe above information has been designed to indicate the general nature and level of work performed in the role. It is not designed to contain or be interpreted as a comprehensive inventory of all responsibilities and qualifications required of employees assigned to this job. The full Job Description can be made available as part of the hiring process.\n\nMinimum Qualifications...\n\nOutlined below are the required minimum qualifications for this position. If none are listed, there are no minimum qualifications.\n\nOption 1: Bachelor's degree in computer science, computer engineering, computer information systems, software engineering, or related area and 4 years' experience in software engineering or related area.Option 2: 6 years' experience in software engineering or related area.\n\nPreferred Qualifications...\n\nOutlined below are the optional preferred qualifications for this position. If none are listed, there are no preferred qualifications.\n\nMaster's degree in Computer Science, Computer Engineering, Computer Information Systems, Software Engineering, or related area and 2 years' experience in software engineering or related area\n\nPrimary Location...\n603 MUNGER AVE STE 400, DALLAS, TX 75202, United States of America",
