      job_apply_is_direct: false,
      job_apply_quality_score: 0.6785,
      job_description:
        "As a Barclays Vice President - Senior Software Developer, get an exciting opportunity to be part of the Planning & Stress Testing project. For this role, you must have to be an enthusiastic developer eager to learn and grow your skills in the field. Your accountabilities include using your technical knowledge and analytical skills to develop the products software design, coding, code reviews and stretch of knowledge as we come up with new solutions to the challenges we encounter.\n\nBarclays is one of the world's largest and most respected financial institutions, with 329 years of success, quality and innovation behind us. We've helped millions of individuals and businesses thrive, creating financial and digital solutions that the world now takes for granted. An important and growing presence in the USA, we offer careers providing endless opportunity.\n\nWorking Flexibly\nWe're committed to providing a supportive and inclusive culture and environment for you to work in. This environment recognizes and supports ways to balance your personal needs, alongside the professional needs of our business. Providing the opportunity for all our employees, globally to work flexibly empowers each of us to work in a way that suits our lives as well as enabling us to better service our customers' and clients' needs. Whether you have family commitments or you're a carer, or whether you need study time or wish to pursue personal interests, our approach to working flexibly is designed to help you balance your life. If you would like some flexibility, then please discuss this with the hiring manager, and your request will be reviewed subject to business needs.\n\nWe are currently in the early stages of implementing a hybrid working environment, which means that many colleagues spend part of their working hours at home and part in the office, depending on the nature of the role they are in. We're flexible on how this works and it may continue to change and evolve. Depending on your team, typically this means that colleagues spend a minimum of between 20% to 60% of their time in the office, which could be over a week, a month, or a quarter. However, some colleagues may choose to spend more time in the office over a typical period than their role type requires. We also have a flexible working process where, subject to business needs, all colleagues globally are able to request work patterns to reflect their personal circumstances. Please discuss the detail of the working pattern options for the role with the hiring manager.\n\nWhat will you be doing?\n• Assisting the entire SDLC with a thorough understanding and experience of Java technologies\n• Writing code to specification for one or more applications/products during the build phase of the SDLC\n• Testing the code thoroughly to ensure delivery is fit for purpose\n• Developing a technical grasp of a component or sub-component within an application/product, providing support for technical queries, and issuing fixes\n• Ensuring that the technical integrity and quality of the applications/products are maintained across their lifetime, and contributing to the development of any technical changes proposed\n• Identifying problems, gathering relevant data, performing root cause analysis, evaluating results, considering alternatives and implications, and implementing the best suited solution\n\nWhat we're looking for:\n• Several years' experience of Java development experience\n• Bachelor's degree in Core Computer Science/Compiler Theory background from a university\n\nSkills that will help you in the role:\n• Understanding of Big Data concepts & technologies (Hive, Impala, Spark, Hadoop)\n• Proficiency in Linux environment\n• Experience working closely with git/perforce\n• Familiarity with unit testing and test-driven development\n\nWhere will you be working?\nAt Barclays, we are proud to be redefining the future of finance and here at Whippany we are defining the future of the workplace and the future of the way we work and live. We are creating a unique community, one of four strategic tech-enabled hubs that will redefine opportunity for everyone who works here. Whatever you do at Whippany, you'll have every chance to build a world-class career in this world-class environment.\n\n#software",
