      job_description:
        "TMC, a LinQuest company is seeking a Software Developer/Engineer to join our team at our office in Colorado Springs, CO. US citizenship and the ability to obtain a Secret clearance is required.\n\nThe Software Developer/ Engineer designs, develops, and deploys software solutions and supports the software development team. Applies basic science and/or engineering techniques to develop economical solutions to technical problems. Specifies functional requirements, designs computer simulation, client-server architectures, advanced networking techniques and protocols, data bases, high-order programming languages, and operating systems (e.g., UNIX/ULTRIX, HP-UX, SUN-OS, VAX/VMS, Harris VOS). Designs and develops basic networking techniques and protocols, data base management systems, and program in high order languages.\n\nResponsibilities:\n• Develop software solutions and architectures by studying information needs; conferring with users; studying systems flow, data usage, data storage requirements, and work processes; investigating problem areas; following the software development lifecycle.\n• Determine operational feasibility and risk by evaluating analysis, problem definition, requirements, solution development, and proposed solutions.\n• Produce and demonstrate solutions by developing documentation, flowcharts, layouts, diagrams, charts, code comments and clear code.\n• Prepare and install system architecture solutions by determining and designing system specifications, standards, and programming.\n• Develop user friendly interfaces; both fast-development engineering GUIs and production level enterprise GUIs.\n• Participate in hardware integration and on-site troubleshooting and acceptance events.\n• Test software solutions, including unit testing, functional testing, integration testing, end-to-end testing, acceptance testing, and performance testing.\n• Deploy software solutions in multiple environments and monitor status of deployed software.\n• Improve operations by conducting systems analysis; recommend changes in policies and procedures.\n• Protect operations by keeping information confidential.\n• Make informed decisions quickly and take ownership of services and applications at scale.\n• Quickly adapt to using new software frameworks, languages, and libraries to meet specific requirements.\n• Analyze, maintain, scale, and develop additional features for large pre-existing code bases.\n• Collaborate with Product Scrum Teams to:\n• Understand functional requirements and deliver high quality working software throughout sprints, demos, releases and the full software development life cycle.\n• Participate in scrum ceremonies including story mapping, backlog refinement, sprint planning and retrospectives.\n• Demonstrate work in sprint demo and customer demos for feedback.\n• Effectively communicate technical information in a clear and concise manner.\n• Other duties as assigned.\n\nRequired Knowledge, Skills, and Experience\n\nExposure and fundamental knowledge of the following:\n\nLanguages:\n• C#, C++, Java or similar language\n• Javascript, Python, Bash\n• SQL, noSQL\n• HTML5/CSS3\n\nPlatform Libraries/Frameworks:\n• net core\n• NodeJS\n• Amazon Web Services (AWS)\n• EFK Stack (Elasticsearch, FluentD and Kabana)\n• PyTest, Mocha, Jest, MsTest, nUnit and nSubstitute\n\nParadigms:\n• APIs: REST, GRPC\n• Network Protocols: TCP/IP, HTTP, I2C, GPIO, CAN bus\n• Microservices\n• MVC Architectures\n• UI/UX\n• Version Control: Git, Gitlab, SVN, Docker images\n• Continuous Integration/Continuous Deployment (CI/CD)\n• Software testing (Unit, Integration, End-to-end, Acceptance, and Performance Testing)\n• Database design and management\n• Algorithm development\n\nAgile and Scrum:\n• Ability to work in an agile development environment\n• Have strong written, verbal, and interpersonal communication skills\n• Ability to work both independently and in a team environment\n\nOperating System Familiarity:\n• MacOS, Windows, Unix Systems\n• Virtual machines\n• Docker and Kubernetes\n• Must be eligible for a DoD TS security clearance with SCI eligibility\n• Must possess a valid driver's license\n\nYears of Experience:\n• Relative entry level experience as Software Programmer/Developer/Engineer\n\nEducation:\n• Bachelor's Degree in Software Engineering, Computer Science or related Engineering or Technical field\n\nCompensation:\n• Starting salary ranges from $90,000 to $160,000 depending on relevant experience and qualifications\n\nBenefits:\n\nTMC, a LinQuest company, offers comprehensive and competitive benefit offerings to our team members to include medical, dental, vision, retirement, paid time off, company paid life insurance, and more! For additional information please visit: https://www.linquest.com/careers/our-benefits\n\nEqual Opportunity Employer/Protected Veterans/Individuals with Disabilities\n\nThe contractor will not discharge or in any other manner discriminate against employees or applicants because they have inquired about, discussed, or disclosed their own pay or the pay of another employee or applicant. However, employees who have access to the compensation information of other employees or applicants as a part of their essential job functions cannot disclose the pay of other employees or applicants to individuals who do not otherwise have access to compensation information, unless the disclosure is (a) in response to a formal complaint or charge, (b) in furtherance of an investigation, proceeding, hearing, or action, including an investigation conducted by the employer, or (c) consistent with the contractor's legal duty to furnish information. 41 CFR 60-1.35(c)",
