      job_apply_quality_score: 0.8743,
      job_description:
        "Description:\n\nThe Software Engineer will work with multidisciplinary teams developing complex engineering solutions for a global Avionic engineering organization responsible for the design, development, and maintenance of the manufacturing test solutions. As a key member of the Avionics Test Engineering team, the Software Engineer will join project execution teams. Here you will be given software tasks developing product tests for a variety of Aerospace products.\n\nThe primary responsibility for this position is to develop new manufacturing and service test solutions for Aerospace products, participating in the entire development lifecycle. The engineer who fills this position will develop strong troubleshooting and problem solving skills. This position will heavily utilize software development and debug skills on multi-rack test stations used to test Aerospace products. These test stations may include but are not limited by the following test equipment: Digital multi-meters, oscilloscopes, network analyzers, spectrum analyzers, logic analyzers, power supplies and electronic loads.\n\nJob Responsibilities\n• Review product designs and create test solutions that maximize test coverage in the manufacturing and service environments\n• Integrate and troubleshoot HW & SW solutions\n• Work closely with other engineering disciplines (e.g., mechanical and systems engineering) to ensure the software design is appropriate for the project/product design approach\n• Ability to reverse engineer existing solutions (e.g., modifying and documenting something that is already developed)\n• Support automated test software development\n• Create, review, and verify automated test procedures that will drive software development\n• Prepare and present project / technical information to peers, internal management and customers\n• Demonstrate excellent time management skills - ability to multitask and collaborate tasks assignments among peers\n• Demonstrate knowledge of software processes, tools, methods, workflow, and best practices\n\nSkills & Qualifications:\n\nBasic Qualifications\n• 5+ yrs experience with C#, C++, LabView;\n• Embedded systems programing\n• Bachelor's degree in a Science, Technology, Engineering or Math (STEM) discipline\n• Have good communication, documentation, and collaboration/teamwork skills\n• Software development experience/proficiency\n\nDesired Skills\n• Have domain knowledge of avionics products\n• Avionic systems for debugging\n\nAbout Actalent:\n\nActalent connects passion with purpose. Our scalable talent solutions and services capabilities drive value and results and provide the expertise to help our customers achieve more. Every day, our experts around the globe are making an impact. We’re supporting critical initiatives in engineering and sciences that advance how companies serve the world. Actalent promotes consultant care and engagement through experiences that enable continuous development. Our people are the difference. Actalent is an operating company of Allegis Group, the global leader in talent solutions.\n\nThe company is an equal opportunity employer and will consider all applications without regards to race, sex, age, color, religion, national origin, veteran status, disability, sexual orientation, gender identity, genetic information or any characteristic protected by law.",
