        "https://careers.mastercard.com/us/en/job/R-187904/Senior-Software-Engineer-API-Platform",
      job_apply_is_direct: false,
      job_apply_quality_score: 0.9104,
      job_description:
        "Our Purpose\n\nWe work to connect and power an inclusive, digital economy that benefits everyone, everywhere by making transactions safe, simple, smart and accessible. Using secure data and networks, partnerships and passion, our innovations and solutions help individuals, financial institutions, governments and businesses realize their greatest potential. Our decency quotient, or DQ, drives our culture and everything we do inside and outside of our company. We cultivate a culture of inclusion for all employees that respects their individual strengths, views, and experiences. We believe that our differences enable us to be a better team – one that makes better decisions, drives innovation and delivers better business results.\n\nJob Title\n\nSenior Software Engineer - API Platform\n\nOverview\n\nMastercard Developers(https://developer.mastercard.com) is the primary API platform for Mastercard partners to access a diverse range of payment, data, loyalty, and security APIs. The team is responsible for delivering an experience that ensures developers can quickly find the right API, assess its technical capabilities and integrate it into new and innovative solutions. Mastercard Developers is looking for a versatile and customer-obsessed Software Developer to join our team. You will play a key role in designing and developing next-generation products and services in Mastercard for a global audience.\n\n• Would you enjoy collaborating with your team to design new features and solutions in an evolving Enterprise environment?\n• Do you have a strong background in developing and delivering high volume web services?\n• Are you passionate about delivering high quality, high performing and highly extensible software?\n• Are you as excited about the value of what you design and build for your customers as you are by the journey to deliver it?\n• Do you want to be part of one of the most exciting global initiatives in Mastercard right now?\n\nRole\n\n• Lead planning, design and implementation of technical solutions for global customers (internal and external)\n• Continually ideate, scope, develop, deliver, test and iterate features for the constantly evolving and growing API Platform.\n• Contribute to Mastercard Open Source projects that offer API Client signing and encryption libraries.\n• Ensure appropriate levels of automation are adopted (build, deploy, configure, validate, monitor).\n• Liaise with other global technology, data, operations teams to execute.\n• Act as subject matter expert for API Platform and services to support customer integrations on occasion\n\nAll About You\n\n• Strong Java and object-oriented design and development skills.\n• React ES6 JavaScript skills, including areas of functional, asynchronous programming.\n• Knowledge of Node.js, NPM, Webpack and Jest.\n• Knowledge of NextJS, Jamstack (Hugo) is preferred.\n• Proven track record in web application development\n• You care about the technical architecture and design - ensuring that the solution is flexibly designed and performs efficiently.\n• Experienced working in an Agile environment with a global team that makes frequent production releases.\n• Background in Dev/Ops a distinct advantage.\n• Background in automation a distinct advantage.\n• Experience in designing and delivering APIs and security models an advantage\n• You strive to create highly intuitive and responsive products.\n\nIn the US, Mastercard is an inclusive Equal Employment Opportunity employer that considers applicants without regard to gender, gender identity, sexual orientation, race, ethnicity, disabled or veteran status, or any other characteristic protected by law. If you require accommodations or assistance to complete the online application process, please contact reasonable_accommodation@mastercard.com and identify the type of accommodation or assistance you are requesting. Do not include any medical or health information in this email. The Reasonable Accommodations team will respond to your email promptly.\n\nCorporate Security Responsibility\nAll activities involving access to Mastercard assets, information, and networks comes with an inherent risk to the organization and, therefore, it is expected that every person working for, or on behalf of, Mastercard is responsible for information security and must:\n• Abide by Mastercard’s security policies and practices;\n• Ensure the confidentiality and integrity of the information being accessed;\n• Report any suspected information security violation or breach, and\n• Complete all periodic mandatory security trainings in accordance with Mastercard’s guidelines.\n\nNYC Salary Range: $134,000 - $208,000",
