      job_description:
        "Description\n\nAre you seeking a new opportunity to develop front and back end solutions for new and existing software and web applications? This role is about building new & maintaining legacy apps on a broad portfolio of tech stacks that support both internal business & external customer clientele with 2-week sprints on a high functioning Agile team, Requirements includes: APIs, Microservices, Integrations, Full-Stack apps; data functionality, architecture, Unit testing, CI/CD, etc. This is a remote HYBRID opportunity and would require the first week onsite, then as needed. Let's talk about this .net Software engineer opportunity - please call me direct at or email your resume direct! My full contact information can be found on LinkedIn under Shawn M Troy - Technology Practice Director with Robert Half..\n\nRequirements\n\n- This position will be the best fit for a candidate with experience with software development life cycles, e.g. Agile, Big Bang, Spiral, Waterfall, etc.\n\n- If you can write clean, standardized code that performs optimally in highly concurrent environments, you will be strongly preferred\n\n- Proven knowledge of Web Development\n\n- Proficiency in JavaScript\n\n- C Sharp Programming (C#) experience preferred\n\n- Comprehensive knowledge of .NET\n\n- Command of Azure SQL Database\n\n- API Development experience highly desired\n\n- Familiarity with scrum\n\n- Experience with at least one framework/library, e.g. Vue.js, Polymer, Angular.js, React.js, Ractive.js, Knockout.js, Ember.js, Bootstrap, etc., are strongly preferred.\n\n- Experience with API design\n\n- It is preferred for applicants to have knowledge of education standards such as QTI/APIP, SIF, AIF\n\n- You might be a good fit for this position if you have familiarity with full-stack development (front-end, to middle/application tier, to database)\n\nTechnology Doesn't Change the World, People Do.®\n\nRobert Half is the world's first and largest specialized talent solutions firm that connects highly qualified job seekers to opportunities at great companies. We offer contract, temporary and permanent placement solutions for finance and accounting, technology, marketing and creative, legal, and administrative and customer support roles.\n\nRobert Half puts you in the best position to succeed by advocating on your behalf and promoting you to employers. We provide access to top jobs, competitive compensation and benefits, and free online training. Stay on top of every opportunity - even on the go. Download the Robert Half app and get 1-tap apply, instant notifications for AI-matched jobs, and more.\n\nAll applicants applying for U.S. job openings must be legally authorized to work in the United States. Benefits are available to contract/temporary professionals, including medical, vision, dental, and life and disability insurance. Hired contract/temporary professionals are also eligible to enroll in our company 401(k) plan. Visit roberthalf.gobenefits.net for more information.\n\n© 2023 Robert Half. An Equal Opportunity Employer. M/F/Disability/Veterans. By clicking \"Apply Now,\" you're agreeing to Robert Half's Terms of Use.",
