        "Description:\n\nThis company is looking to bring in a fullstack Software Engineer who will be focused mostly python backend microservices to execute all the business logic, talk to databases (not a heavy database application but has some data that goes into the database). Will be writing full applications using python. Their backend python services is a web application and have their software application in the browser. The balloons send commands for the web applications to exectue planning operations an manage power usage.\n\nSkills:\n\nPython, Software development, vue.js\n\nTop Skills Details:\n\nPython,Software development\n\nAdditional Skills & Qualifications:\n\nThought leadership and technical leadership would be a plus.\n\n- Ideal if person also have some experience on the front-end WEb UI as things are connecting on the backend. Currently have Vue.JS but open if people also have Rreact, Angular, etc.\n\nExperience Level:\n\nEntry Level\n\nMUST BE LOCAL TO SIOUX FALLS OR OPEN TO RELOCATE\n\nAbout TEKsystems:\n\nWe're partners in transformation. We help clients activate ideas and solutions to take advantage of a new world of opportunity. We are a team of 80,000 strong, working with over 6,000 clients, including 80% of the Fortune 500, across North America, Europe and Asia. As an industry leader in Full-Stack Technology Services, Talent Services, and real-world application, we work with progressive leaders to drive change. That's the power of true partnership. TEKsystems is an Allegis Group company.\n\nThe company is an equal opportunity employer and will consider all applications without regards to race, sex, age, color, religion, national origin, veteran status, disability, sexual orientation, gender identity, genetic information or any characteristic protected by law.",
