      job_description:
        "Software Engineer, Mid\n\nKey Role:\n\nDesign and develop high-performance application frameworks and software for high-speed protocol identification and processing. Use C++ and Java on a Linux platform and work within an Agile team to build and modernize a mission capability. Analyze the needs and the environment to make sure the solution you’re developing considers the architecture and operating environment, as well as future functionality and enhancements. Leverage the full SDLC or DevOps pipeline to drive rapid, quality delivery of functionality to the client at the speed of their mission. Engage multiple functional groups to comprehend client challenges, prototype new ideas and new technologies, and help to create solutions to drive the next wave of innovation. Design, implement, schedule, test, and deploy full features and components of solutions. Ensure quality delivery of software through thorough testing and reviews. Develop technical solutions to complex problems which require the regular use of ingenuity and creativity.\n\nBasic Qualifications:\n• Experience with Python\n• Experience developing in an Agile environment\n• Experience developing on Cloud Platforms\n• TS/SCI clearance with a polygraph\n• HS Diploma or GED\n\nClearance:\n\nApplicants selected will be subject to a security investigation and may need to meet eligibility requirements for access to classified information; TS/SCI clearance with polygraph is required.\n\nCompensation\n\nAt Booz Allen, we celebrate your contributions, provide you with opportunities and choices, and support your total well-being. Our offerings include health, life, disability, financial, and retirement benefits, as well as paid leave, professional development, tuition assistance, work-life programs, and dependent care. Our recognition awards program acknowledges employees for exceptional performance and superior demonstration of our values. Full-time and part-time employees working at least 20 hours a week on a regular basis are eligible to participate in Booz Allen’s benefit programs. Individuals that do not meet the threshold are only eligible for select offerings, not inclusive of health benefits. We encourage you to learn more about our total benefits by visiting the Resource page on our Careers site and reviewing Our Employee Benefits page.\n\nSalary at Booz Allen is determined by various factors, including but not limited to location, the individual’s particular combination of education, knowledge, skills, competencies, and experience, as well as contract-specific affordability and organizational requirements. The projected compensation range for this position is $58,300.00 to $133,000.00 (annualized USD). The estimate displayed represents the typical salary range for this position and is just one component of Booz Allen’s total compensation package for employees.\n\nWork Model\nOur people-first culture prioritizes the benefits of flexibility and collaboration, whether that happens in person or remotely.\n• If this position is listed as remote or hybrid, you’ll periodically work from a Booz Allen or client site facility.\n• If this position is listed as onsite, you’ll work with colleagues and clients in person, as needed for the specific role.\n\nEEO Commitment\n\nWe’re an equal employment opportunity/affirmative action employer that empowers our people to fearlessly drive change – no matter their race, color, ethnicity, religion, sex (including pregnancy, childbirth, lactation, or related medical conditions), national origin, ancestry, age, marital status, sexual orientation, gender identity and expression, disability, veteran status, military or uniformed service member status, genetic information, or any other status protected by applicable federal, state, local, or international law.",
